    'page.body.help.que1': 'Why do I need a secure 2FA authentication?',
    'page.body.help.ans1head': '2FA Codes',
    'page.body.help.ans1': 'It is the most secure system available. Avoids unauthorized access and movement of funds. Only you have access to them with a 2FA system enabled.',
    'page.body.help.que2': 'How do I activate 2FA on my account?',
    'page.body.help.ans2head': 'Activate 2FA',
    'page.body.help.ans2': 'Click on your Profile and the Enable 2FA button.Follow the steps and store the initial code provided, it will allow recovering your account in case you lose access to your phone',
    'page.body.help.que3': 'What do I do if I lose access to my phone and cannot access 2FA?',
    'page.body.help.ans3head': 'Lost access to 2FA',
    'page.body.help.ans3': 'If you have stored the initial code provided you can re-enable your account on your phone. If not, contact support, you will be asked some questions and possibly asked to provide proof of identity before 2fa will be disabled.',
    'page.body.help.que4': 'What do I do if I lose access to my phone and cannot access 2FA?',
    'page.body.help.ans4head': 'Lost access to 2FA',
    'page.body.help.ans4': 'If you have stored the initial code provided you can re-enable your account on your phone. If not, contact support, you will be asked some questions and possibly asked to provide proof of identity before 2fa will be disabled.',
    'page.body.help.que5': 'How do I create a deposit address?',
    'page.body.help.ans5head': 'Create a Deposit Address',
    'page.body.help.ans5': 'Click on “Balances” tab on the top. Click on the coin name and the right panel will show up. Click on “Deposit” and the address will be generated. Send your coins to the address and after a certain amount of time that depends on the speed of the blockchain it will reflect on your balance.',
    'page.body.help.que6': 'My deposit does not show up.',
    // 'page.body.help.ans6head': '',
    'page.body.help.ans6': 'Your funds are always safe when you send into the platform. The funds will be credited when they reach the required confirmation. On the Deposit dashboard, you can check and track it on their blockchain explorer.',
    'page.body.help.que7': 'How do I withdraw my coins?',
    'page.body.help.ans7head': 'Withdrawals',
    'page.body.help.ans7': 'While logged in to your account click on the Balances tab on the top. Find the token you wish to withdraw on the list, click on the coin name and the right panel will show up. Enable 2FA security and follow the steps. You will be requested to confirm the withdrawal address  to through an email before it gets processed.',
    'page.body.help.que8': 'Why is my withdrawal under review?',
    'page.body.help.ans8head': 'Withdrawal under review',
    'page.body.help.ans8': 'If you are a new user, or are making a large withdrawal, your transaction may be slightly delayed due to a manual review of your transaction.',
    'page.body.help.que9': 'What are the fees for trading?',
    'page.body.help.ans9head': 'Trading Fees',
    'page.body.help.ans9': 'Current fees regarding them can be found on every market available.',
    'page.body.help.que10': 'What are the fees for withdrawals?',
    'page.body.help.ans10head': 'Withdrawal Fees',
    'page.body.help.ans10': 'Current fees and other information regarding them can be found on the Balance page.',
    'page.body.help.que11': 'Does Myce require personal identification (KYC)?',
    'page.body.help.ans11head': 'KYC',
    'page.body.help.ans11': 'Myce does not require KYC. We comply with legal provisions with restricted trading and withdrawal levels within the platform, each of which have certain requirements. When upgrading to the next level, we conduct a “Know Your Customer” process and use it to verify the identity of our customers to prevent: Identity Theft, Financial Fraud, Money Laundering, among others.',
    'page.body.help.que12': 'What are my trade limits?',
    'page.body.help.ans12head': 'Trade Limits',
    'page.body.help.ans12': 'Minimum trade limits depend on the coin and are visible on the Balance page on each coin dashboard.',
    'page.body.help.que13': 'I am not receiving authorization emails, what can I do?',
    'page.body.help.ans13head': 'Not receiving Emails',
    'page.body.help.ans13': 'Check the Spam folder. When you find a message in Spam folder mark it as Not spam to make sure it goes in your inbox next time.',
